:"2016-11-10 02:01:18","offSaleDate":"2016-11-27 23:00:00","onSaleDates":[{"name":"On Sale","startDate":"2016-11-10 02:01:18","endDate":"2016-11-27 23:00:00"}],"topLineInfo":"AR Rich presents: Steve Pointdexter + Gene Hunt","promoterName":"AR Rich presents: Steve Pointdexter + Gene Hunt","sponsorName":"","sponsorImage":null,"additionalInfo":"","additionalTicketText":"","ageLimitCode":"OVER_21","ageLimit":"21 and Over","showTypeCode":null,"showType":"","eventStatusCode":"BUY","eventStatus":"Buy","eventStatusMessage":"","ticketPurchaseUrl":"https://www.ticketfly.com/purchase/event/1383479?utm_medium=api","ticketPrice":"$0.00 - $10.00","externalTicketingUrls":[],"multiEventCartable":true,"facebookEventId":"","facebookEventIdString":"","headliners":[{"id":1771414,"name":"Steve Pointdexter","startTime":null,"eventDescription":"","isMobileFriendly":"false","image":null,"youtubeVideos":[],"embedAudio":"","embedVideo":"","urlAudio":"","urlPurchaseMusic":"","urlOfficialWebsite":"","urlMySpace":"","urlFacebook":"","urlTwitter":"","twitterScreenName":""},{"id":1027481,"name":"Gene Hunt","startTime":null,"eventDescription":"On any given night in Chicago, it's more likely than not that Gene Hunt is somewhere, crouched over the decks and working his magic. One of the true representatives of Chicago House Music, Gene is one of the top artists to emerge from the city, with a career spanning back to the initial wave in the early 1980s. As a teenager, he played at many of the key touchstones of the first generation of House Music spots, including the Warehouse, The Playground and The Music Box; he's been best known in the last few years for a series of tracks made then with the legendary Ron Hardy.

As a producer, Gene Hunt's first EP was Living in a Land, released on Chicago's Trax Records and co-produced and shepherded by Armando Gallop. From an early age, Gene imprinted his stamp on his musical style with an alteration between soulful, vocal recordings and harder, rough tech-y tracks. (And sometimes both in the same release - see, for instance, "Twilight People" featuring Robert Owens on vocals). By 1999 he had more than enough releases on his belt for a "Greatest Hits" double LP (Gene Hunt Classics, Dust Traxx).

In the years following, Gene Hunt released some of his best records on labels including Dope Wax, Track Mode, Got Soul and Unified, and delivered a tour de force in 2011 when noted Dutch label Rush Hour released Gene Hunt Presents Chicago Dance Tracks, a collection of some sixteen unreleased records from the likes of Larry Heard & Marshall Jefferson, Steve "Silk" Hurley, Farley Jackmaster Funk, Lil Louis and Ron Hardy. As a follow up, in early 2012 Gene released an original two track EP, May The Funk Be With You, also on Rush Hour, with a remix from Theo Parrish.","isMobileFriendly":"false","image":null,"youtubeVideos":[],"embedAudio":"","embedVideo":"","urlAudio":"","urlPurchaseMusic":"","urlOfficialWebsite":"","urlMySpace":"","urlFacebook":"https://www.facebook.com/gene.hunt.777","urlTwitter":"","twitterScreenName":""},{"id":766477,"name":"Robert Armani","startTime":null,"eventDescription":"","isMobileFriendly":"false","image":null,"youtubeVideos":[],"embedAudio":"","embedVideo":"","urlAudio":"","urlPurchaseMusic":"","urlOfficialWebsite":"","urlMySpace":"","urlFacebook":"","urlTwitter":"","twitterScreenName":""}],"supports":[{"id":1771416,"name":"Track Master Scott","startTime":null,"eventDescription":"","isMobileFriendly":"false","image":null,"youtubeVideos":[],"embedAudio":"","embedVideo":"","urlAudio":"","urlPurchaseMusic":"","urlOfficialWebsite":"","urlMySpace":"","urlFacebook":"","urlTwitter":"","twitterScreenName":""},{"id":1771417,"name":"Rick "Ice Kold" Johnson","startTime":null,"eventDescription":"","isMobileFriendly":"false","image":null,"youtubeVideos":[],"embedAudio":"","embedVideo":"","urlAudio":"","urlPurchaseMusic":"","urlOfficialWebsite":"","urlMySpace":"","urlFacebook":"","urlTwitter":"","twitterScreenName":""},{"id":1771418,"name":"DJ Queen B","startTime":null,"eventDescription":"","isMobileFriendly":"false","image":null,"youtubeVideos":[],"embedAudio":"","embedVideo":"","urlAudio":"","urlPurchaseMusic":"","urlOfficialWebsite":"","urlMySpace":"",